    render() {
        return (
            <div className="shadow-sm">
                <nav className="navbar navbar-dark bg-dark">
                    <div className="container-fluid">
                        <a className="navbar-brand" href="#">CV Project</a>
                    </div>
                </nav>
            </div>

        );
    }
}

export default TopBar;
